   DBMS_OUTPUT.PUT_LINE('Creando dd_tpr_tipo_prod......');
   FOR I IN V_TIPO_TPR.FIRST .. V_TIPO_TPR.LAST
   LOOP
       V_MSQL := 'SELECT '||V_ESQUEMA||'.S_DD_TPR_TIPO_PROD.NEXTVAL FROM DUAL';
